import React from 'react';


const TablaUsuario = () => {
    return ( 
        <div className="container d-flex">

         <div className="row">
             <div className="col">

                 <h2>ADD user</h2>
             </div>
             <div className="col">
                 <h2>Ver Usuarios</h2>
                 <div className="row">
                   <TablaUsuario/>
                 </div>
             </div>
            </div>
        </div>
     );
}

export default TablaUsuario;
